import React from 'react';
import ReactDOM from 'react-dom/client';
import FunctionalComponent from './components/FunctionalComponent';
import { ClassComponent } from './components/ClassComponent';
import PropsInFunctionalComponentReact from './state&props/PropsInFunctionalComponent';
import PropsInClassComponent from './state&props/StateInClassComponent';
import StateInFunctionalComponent from './state&props/StateInFunctionalComponent';
import StateInClassComponent from './state&props/StateInClassComponent'
import ListAndKey from './utils/List&Keys';
import Routing from './pages/Routing';
import UseEffectHook from './hooks/useEffectInReact';
import UseReducerHook from './hooks/useReducerHook';
import Component1 from './hooks/useContextHook'
import useRefHookInReact from './hooks/useRefHook';

let root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <React.StrictMode>
        <Routing />
        <FunctionalComponent />
        <ClassComponent />
        <PropsInFunctionalComponentReact name="Mansoor" age="20" />
        <PropsInClassComponent yoe='2' salary='3.75' />
        <StateInFunctionalComponent />
        <StateInClassComponent />
        <ListAndKey />
        <UseEffectHook />
        <UseReducerHook />
        <Component1 />
           </React.StrictMode>
);
